import{_ as o,c as t,o as e,a as c}from"./app.733a6325.js";const f=JSON.parse('{"title":"GitHub Copilot","description":"","frontmatter":{},"headers":[{"level":2,"title":"JavaScript \u6E2C\u8A66","slug":"javascript-\u6E2C\u8A66"},{"level":2,"title":"python \u6E2C\u8A66","slug":"python-\u6E2C\u8A66"},{"level":2,"title":"\u5FC3\u5F97","slug":"\u5FC3\u5F97"}],"relativePath":"coding/GithubCopilot.md"}'),p={name:"coding/GithubCopilot.md"},r=c('<h1 id="github-copilot" tabindex="-1">GitHub Copilot <a class="header-anchor" href="#github-copilot" aria-hidden="true">#</a></h1><blockquote><p>Nov 15, 2021</p></blockquote><p>\u5982\u984C\uFF0C\u9019\u6B21\u8981\u5206\u4EAB\u7684\u662F<a href="https://copilot.github.com/" target="_blank" rel="noreferrer">GitHub Copilot</a>\uFF0C\u7C21\u55AE\u8AAA\u5C31\u662F AI \u6703\u5E6B\u4F60\u5BEB\u7A0B\u5F0F\uFF01\uFF01\uFF01<br> \u770B\u8D77\u4F86\u662F\u53EA\u8981\u7D66\u660E\u78BA\u5B9A\u7FA9\u7684 function \u540D\u7A31\uFF0C\u4ED6\u5C31\u6703\u81EA\u52D5\u5E6B\u4F60\u751F\u6210\u7A0B\u5F0F\u78BC\uFF0C\u6709\u8208\u8DA3\u7684\u53EF\u4EE5\u9EDE\u4E0A\u9762\u9023\u7D50\u53BB\u770B\u8A73\u7D30\u7684\u4ECB\u7D39\uFF0C\u6BD4\u8F03\u53EF\u60DC\u7684\u662F\u4ED6\u73FE\u5728\u9084\u6C92\u6709\u5B8C\u5168\u958B\u653E\u7D66\u6240\u6709\u4EBA\u4F7F\u7528\uFF0C\u5FC5\u9808\u53BB\u7533\u8ACB\u6392\u968A\uFF0C\u7136\u5F8C\u7B49\u5F85\u901A\u77E5\uFF0C\u5176\u5BE6\u6211\u4E5F\u4E0D\u77E5\u9053\u6703\u4E0D\u6703\u6709\uFF0C\u56E0\u70BA\u6211\u6839\u672C\u9084\u6C92\u6709\u6536\u5230\u4FE1\uFF0C\u6240\u4EE5\u7B49\u6536\u5230\u4FE1\u4E4B\u5F8C\u8003\u616E\u518D\u4F86\u8A73\u7D30\u5BEB\u4E00\u7BC7\u3002<br> \u770B\u5230\u9019\u61C9\u8A72\u5F88\u591A\u4EBA\u89BA\u5F97\u6211\u9019\u7BC7\u662F\u5728\u5BEB\u5FC3\u9178\u7684\uFF0C\u7B49\u7B49\uFF01\u5148\u5225\u6025\u8457\u95DC\u6389\uFF0C\u4E0B\u6ED1\u6709\u9A5A\u559C\u554A\uFF01</p><p><img src="https://i.imgur.com/RAnijuL.png" alt=""></p><p>\u96D6\u7136\u6211\u6C92\u6709\u4F46\u662F\u5F37\u8005\u6211\u4E3B\u7BA1\u6709\uFF01<br> \u9019\u7BC7\u8981\u611F\u8B1D\u54F2\u4EF0\u5927\u795E\uFF0C\u5C11\u6578\u53EF\u4EE5\u512A\u5148\u5690\u9BAE\u7684\u4EBA\u5929\u9078\u4E4B\u4EBA\uFF01<br> \u4EE5\u4E0B\u6E2C\u8A66\u90FD\u662F\u4E00\u4E2D\u4E4B\u5149\u54F2\u4EF0\u5E6B\u5FD9\u505A\u7684\uFF0C\u611F\u6069\u54F2\u4EF0\u8B9A\u5606\u54F2\u4EF0\uFF01</p><p>\u4E00\u958B\u59CB\u5F97\u5148\u5728 vs code \u4E2D\u88DD\u9019\u500B\u5957\u4EF6\uFF0C\u4F46\u662F\u4F60\u5F97\u767B\u5165 github \u624D\u6709\u8FA6\u6CD5\u88DD\uFF0C\u6240\u4EE5\u6211\u73FE\u5728\u4E5F\u9084\u662F\u88DD\u4E0D\u4E86\u3002</p><p><img src="https://i.imgur.com/TGHjAnu.png" alt=""></p><h2 id="javascript-\u6E2C\u8A66" tabindex="-1">JavaScript \u6E2C\u8A66 <a class="header-anchor" href="#javascript-\u6E2C\u8A66" aria-hidden="true">#</a></h2><p>\u88DD\u5B8C\u5F8C\u5C31\u53EF\u4EE5\u958B\u59CB\u4F86\u73A9\u4E86\uFF0C\u9019\u908A\u54F2\u4EF0\u5148\u6E2C\u8A66 JavaScript\uFF0C\u770B\u8D77\u4F86\u662F\u53EA\u8981\u6253\u4E0A function \u540D\u7A31\uFF0C\u4ED6\u5C31\u53EF\u4EE5\u958B\u59CB\u628A\u5269\u4E0B\u7684\u7A0B\u5F0F\u78BC\u88DC\u5B8C\u3002<br> \u9996\u5148\u6211\u5011\u6253\u4E0A<code>getBlackStonesFromSgf</code>\u5982\u540C\u5B57\u9762\u4E0A\u610F\u601D\uFF0C\u76EE\u6A19\u5C31\u662F\u8981\u5F9E sgf \u6A94\u4E2D\u53D6\u51FA\u9ED1\u68CB\u3002<br> \u76F4\u63A5\u4E0A\u5F71\u7247!</p><p>WTF!!!!\u7C21\u76F4\u592A\u72C2\u4E86\uFF0C\u4ED6\u9084\u6703\u81EA\u5DF1\u7528<code>loadSgf</code>\u8DDF<code>sgfToArray</code>\u9019\u5169\u500B function...<br> \u9019\u5169\u500B function \u5C31\u5982\u540C\u5B57\u9762\u4E0A\u7684\u610F\u601D\uFF0C\u4E00\u500B\u662F\u7528\u4F86\u53D6\u51FA sgf \u7684\u8CC7\u8A0A\u3001\u4E00\u500B\u662F\u7528\u4F86\u628A sgf \u68CB\u5B50\u8F49\u6210 array \u7684\u5F62\u5F0F\u3002</p><p><img src="https://i.imgur.com/ogOCG7B.png" alt=""></p><p>\u4ED6\u9084\u5224\u65B7\u51FA\u4E86 X \u5C31\u4EE3\u8868\u8457\u9ED1\u68CB\uFF0C\u592A\u795E\u4E86...<br> \u5C31\u662F<code>let sgf = loadSgf(sgf)</code>\u9019\u908A\u6709\u9EDE\u932F\u8AA4\u5C31\u662F\u4E86\uFF0C\u4E0D\u904E\u56E0\u70BA\u6211\u5011\u4E5F\u6C92\u7D66 input\uFF0C\u57FA\u672C\u4E0A\u4ED6\u7684\u908F\u8F2F\u90FD\u662F\u5C0D\u7684\uFF0C\u800C\u4E14\u9084\u77E5\u9053\u8981\u7528\u4EC0\u9EBC function \u4F86\u8655\u7406 sgf \u6A94\uFF0C\u6211\u7684\u5929\uFF0C\u9019\u771F\u7684\u5687\u58DE\u6211\u4E86\u3002</p><h2 id="python-\u6E2C\u8A66" tabindex="-1">python \u6E2C\u8A66 <a class="header-anchor" href="#python-\u6E2C\u8A66" aria-hidden="true">#</a></h2><p>\u9019\u908A\u6E2C\u8A66\u7684 code \u627F\u63A5\u4E0A\u4E00\u7BC7<a href="https://hackmd.io/@Marsgoat/rotate" target="_blank" rel="noreferrer">\u65CB\u8F49\u68CB\u76E4</a>\uFF0C\u5C31\u662F\u76F4\u63A5\u628A\u4E0A\u4E00\u7BC7\u7684\u6240\u6709 function \u90FD\u4E1F\u9032\u53BB\u540C\u500B\u6A94\u6848\u4E2D\u958B\u59CB\u6E2C\u8A66\uFF0C\u5927\u5BB6\u53EF\u4EE5\u958B\u555F\u4E0A\u4E00\u7BC7\u81EA\u5DF1\u5C0D\u6BD4\u4E00\u4E0B\u3002<br> \u4E00\u958B\u59CB\u5C31\u76F4\u63A5\u653E\u5927\u62DB\uFF0C\u5148\u628A\u672C\u4F86\u7684<code>rotate_move</code>\u7D66\u522A\u6389\uFF0C\u7136\u5F8C\u4EA4\u7D66 copilot \u4F86\u81EA\u5DF1\u5BEB\u3002</p><p><img src="https://i.imgur.com/5FWZluF.png" alt=""></p><p>\u7C21\u6F54\u660E\u77AD\uFF01\u592A\u795E\u4E86\u5427\uFF0C\u6211\u597D\u615A\u6127\uFF0C\u6211\u600E\u9EBC\u53EF\u4EE5\u9019\u9EBC\u721B\uFF0C\u615A\u6127\u5230\u5DF2\u7D93\u5728\u60F3\u6211\u53EF\u4EE5\u8F49\u884C\u505A\u4EC0\u9EBC\u4E86\u3002<br> \u4F46\u662F\u6B64\u6642\u54F2\u4EF0\u767C\u73FE\u4E0D\u592A\u5C0D\uFF0C\u56E0\u70BA\u5176\u5BE6\u6211\u9019\u500B function \u61C9\u8A72\u8981\u53EB\u505A<code>rotate_moves</code>\uFF0C\u5982\u679C\u53EA\u662F<code>rotate_move</code>\u4E0D\u61C9\u8A72\u662F\u9019\u6A23\u5427\uFF0C\u800C\u4E14\u4ED6\u600E\u9EBC\u6703\u77E5\u9053\u6211\u5011\u662F\u60F3\u8981\u8F49 90 \u5EA6\u963F\uFF1F</p><p>\u65BC\u662F\u54F2\u4EF0\u5C31\u63DB\u4E86\u4E00\u500B\u540D\u7A31\u91CD\u65B0\u518D\u8A66\u4E00\u6B21</p><p><img src="https://i.imgur.com/XhQJeeN.png" alt=""></p><p>\u7B49\u7B49...\u9019\u6839\u672C\u662F\u5728\u6284\u6211\u7684 code \u5427\uFF0C\u5BEB\u5F97\u8DDF\u6211\u4E00\u6A23\u721B\uFF0C\u6211\u6A19\u8A18\u68CB\u5B50\u4F7F\u7528 M \u55AE\u7D14\u53EA\u662F move \u7684\u7E2E\u5BEB\uFF0C\u6BEB\u7121\u610F\u7FA9\uFF0C\u4ED6\u4E5F\u7528 M \u9019\u7D55\u5C0D\u662F\u6284\u6211\u7684 code\uFF0Ccopilot \u4F60\u9019\u500B\u6284\u8972\u4ED4\uFF0C\u8981\u6284\u4E5F\u4E0D\u6284\u597D\u4E00\u9EDE\u7684\u3002<br> \u6211\u7684\u8B8A\u6578\u540D\u7A31\u90FD\u662F\u96A8\u5FC3\u6240\u6B32\u6D41\uFF0C\u53EA\u8981\u81EA\u5DF1\u770B\u5F97\u61C2\u5C31\u597D\uFF0C\u9019\u9EDE\u5E38\u5E38\u88AB\u54F2\u4EF0\u5634\uFF0C\u8DDF\u6211\u5171\u4E8B\u679C\u7136\u662F\u5F88\u56F0\u64FE\u5462 XDD\uFF0C\u73FE\u5728\u6211\u90FD\u6703\u5148\u554F\u904E\u4ED6\uFF0C\u54F2\u4EF0\u6839\u672C\u662F\u53D6\u540D\u5C08\u5BB6\u3002</p><p>\u518D\u63DB\u4E00\u500B\u540D\u7A31\u518D\u8A66\u4E00\u6B21\uFF01</p><p><img src="https://i.imgur.com/ShRV155.png" alt=""></p><p>\u9019\u6B21\u5C31\u5F88\u5F37\u4E86\uFF0C\u96D6\u7136\u9084\u662F\u932F\u7684\uFF0C\u4E0D\u662F\u6240\u6709\u68CB\u5B50\u90FD\u662F\u9ED1\u68CB\u554A\uFF0C\u61C9\u8A72\u8981\u4E00\u500B B \u4E00\u500B W \u624D\u5C0D\uFF0C\u9084\u662F\u6211\u7684<code>get_sgf_moves</code>\u5BEB\u5F97\u592A\u721B\u4E86\uFF1F\u4F46\u662F\u4ED6\u5C45\u7136\u81EA\u5DF1\u5224\u8B80\u51FA\u4E86 sgf \u7684\u683C\u5F0F\uFF0C\u7136\u5F8C\u628A\u68CB\u5B50\u62FC\u88DD\u56DE\u53BB\uFF0C\u771F\u7684\u662F\u6709\u9EDE\u53B2\u5BB3\u3002</p><p>\u6700\u5F8C\u8DDF js \u4E00\u6A23\u4E5F\u4F86\u500B\u53D6\u68CB\u5B50\u5427\uFF0C\u9019\u6B21\u63DB\u53D6\u767D\u68CB\u3002</p><p><img src="https://i.imgur.com/osrZjEb.png" alt=""></p><p>\u7C21\u6F54\u660E\u77AD\uFF0C\u53EF\u60DC\u662F\u932F\u7684\uFF0C<code>if x [0] == 0</code>\u9019\u908A\u61C9\u8A72\u662F<code>if x [0] == W</code>\u624D\u5C0D\uFF0C\u800C\u4E14\u5176\u5BE6\u6211\u7684<code>get_sgf_moves</code>\u5DF2\u7D93\u628A B \u8DDF W \u9084\u6709\u4E2D\u62EC\u5F27\u7D66\u62FF\u6389\u4E86\uFF0C\u6240\u4EE5\u9019\u6A23\u6539\u4E5F\u662F\u6C92\u7528\u7684\uFF0C\u4F46\u662F\u4ED6\u80FD\u5BEB\u6210\u9019\u6A23\u6211\u5DF2\u7D93\u5F88\u9A5A\u8A1D\u4E86\u3002</p><h2 id="\u5FC3\u5F97" tabindex="-1">\u5FC3\u5F97 <a class="header-anchor" href="#\u5FC3\u5F97" aria-hidden="true">#</a></h2><p>\u6574\u9AD4\u4F86\u8AAA\u908F\u8F2F\u4E0A\u90FD\u6C92\u6709\u4EC0\u9EBC\u5927\u554F\u984C\uFF0C\u771F\u7684\u5F88\u5F37\uFF0C\u9019\u908A\u662F\u6E2C\u8A66\u4E00\u4E9B\u7B97\u662F\u5F88\u5C11\u898B\u7684\u529F\u80FD\uFF0Ccopilot \u5C45\u7136\u9084\u80FD\u751F\u51FA\u6709\u6A21\u6709\u6A23\u7684 code \u4F86\uFF0C\u800C\u4E14\u50CF\u662F<code>getWhiteMoves</code>\u9019\u6A23\u5BEB\u4ED6\u5C45\u7136\u5C31\u80FD\u731C\u5230\u610F\u601D\uFF0C\u9019\u771F\u7684\u662F\u975E\u5E38\u4EE4\u6211\u9A5A\u8A1D\uFF0C\u770B\u4E86\u4E00\u4E0B\u4ECB\u7D39\u597D\u50CF\u591A\u5BEB\u4E00\u4E9B\u8A3B\u89E3\u7684\u8A71\u6548\u679C\u9084\u6703\u66F4\u597D\u7684\u6A23\u5B50\uFF0C\u5982\u679C\u662F\u5F88\u5E38\u898B\u7684\u908F\u8F2F\u6216\u662F\u6F14\u7B97\u6CD5\u4ED6\u90FD\u662F\u8F15\u8F15\u9B06\u9B06\u641E\u5B9A\u7684\uFF0C\u96D6\u7136\u61C9\u8A72\u90FD\u662F\u6284\u5225\u4EBA\u7684 code \u4F86\u7D66\u4F60\uFF0C\u4F46\u9019\u6A23\u8B93\u4F60\u9023 google \u7684\u6642\u9593\u90FD\u7701\u4E0B\u4F86\u4E86\uFF0C\u4ED6\u9084\u6703\u6839\u64DA\u4F60\u6574\u4EFD code \u5E6B\u4F60\u5BEB\u597D\uFF0C\u9700\u8981\u4FEE\u6539\u7684\u5730\u65B9\u4E5F\u4E0D\u6703\u592A\u591A\uFF0C\u751A\u81F3\u53EF\u80FD\u76F4\u63A5\u5C31\u80FD\u7528\u4E86\uFF0C\u5148\u4E0D\u8003\u616E\u8CC7\u5B89\u554F\u984C\uFF0C\u9019\u8B93\u6211\u9019\u500B cv \u5DE5\u7A0B\u5E2B(\u4E0D\u8981\u8AA4\u6703\uFF0C\u4E0D\u662F computer vision\uFF0C\u800C\u662F ctrl+c\u3001ctrl+v)\u60C5\u4F55\u4EE5\u582A\uFF0C\u672A\u4F86\u6700\u5148\u88AB\u6DD8\u6C70\u7684\u8C8C\u4F3C\u5C31\u662F\u6211\u4E86 QQ\uFF0C\u4ED6\u5BEB\u5F97\u53C8\u5FEB\u53C8\u597D\uFF0C\u5230\u5E95\u8981\u6211\u5E79\u9EBB\uFF1F\u611F\u53D7\u5230\u79D1\u6280\u9032\u6B65\u7684\u540C\u6642\uFF0C\u4E5F\u611F\u53D7\u5230\u81EA\u5DF1\u7684\u4E0D\u8DB3\uFF0C\u771F\u7684\u662F\u65E2\u671F\u5F85\u53C8\u5BB3\u6015\u53D7\u50B7\u5BB3 XDD<br> \u611F\u89BA\u8DDF\u6574\u4EFD code \u7684 function \u547D\u540D\u8DDF\u6578\u91CF\u591A\u5BE1\u4E5F\u662F\u6709\u9EDE\u95DC\u4FC2\uFF0C\u5982\u679C\u662F\u90A3\u7A2E\u5C0F\u529F\u80FD\u90FD\u5BEB\u5F97\u5F88\u5B8C\u5584\u7684\u6A94\u6848\u61C9\u8A72\u6703\u66F4\u597D\u7528\u624D\u5C0D\uFF0C\u672A\u4F86\u6211\u4E5F\u53EF\u4EE5\u88DD\u7684\u6642\u5019\u6211\u518D\u4F86\u5BEB\u4E00\u4E9B\u73A9\u5177\u8DDF\u5927\u5BB6\u8A73\u7D30\u5206\u4EAB\u5427\uFF5E</p><p><a href="/XNnote/coding/">\u56DE\u5230\u76EE\u9304</a></p>',28),i=[r];function a(n,s,d,h,l,g){return e(),t("div",null,i)}const m=o(p,[["render",a]]);export{f as __pageData,m as default};
